import React from 'react';
import { observer } from 'mobx-react';

import InputLabel from '@material-ui/core/InputLabel';
import MenuItem from '@material-ui/core/MenuItem';
import NativeSelect from '@material-ui/core/NativeSelect';

export default observer(({ store, field, type }) => {
    return (
        <div>
            {/* <InputLabel htmlFor={field.id}>{field.label}</InputLabel>
            <NativeSelect id={field.id} {...field.bind({ type })}>
                <option value={''}></option>
                {store.data.map(c => <option key={c.id} value={c.id}>{c.type}</option>)}
            </NativeSelect> */}
            <InputLabel id={field.id}>{field.label}</InputLabel>
            <Select labelId={field.id} {...field.bind({ type })}>
                <MenuItem value={''}></MenuItem>
                {store.data.map(c => <MenuItem key={c.id} value={c.id}>{c.type}</MenuItem>)}
            </Select>
        </div>
    )
});
